import React from 'react'

const TodoList = () => {
    return (
        <div className="app">
            <div className="todo-list">
                {todos.map((todo, index) => (
                    <Todo
                    key={index}
                    index={index}
                    todo={todo}
                    />
                ))}
            </div>
        </div>
    )
}


const Todo = ({ todo }) => <div className="todo">{todo.text}</div>;

export default TodoList
